INSERT INTO `faq` (`faq_id`, `question`, `answer`, `created_by`, `created_at`, `updated_at`) VALUES
(1, 'How do I WHITELIST the sender name PSBTRANZOIA?', 'Whitelist process for Safaricom Users:\n1. On your phone dial *100#\n2. Select Option 5: My Subscriptions\n3. Then select 2: Promotional Messages\n4. Then select 4: Activate by Sender Name\n5. Enter the Sender Name: PSBTRANZOIA', 'Moses Juma', '2025-06-15 15:07:44', ''),
(2, 'Why can\'t I successfully save my information when I\'m on the Professional Skills Tab?', 'If you\'re copying information from your CV, you need to clean up the text by removing unusual characters. Bullet points and formatting can convert into characters that prevent saving.', 'Moses Juma', '2025-06-15 15:09:41', ''),
(3, 'I can\'t find the submission button on my phone.', 'Auto-rotate your phone and switch to landscape mode. The submit button should then become visible. ', 'Moses Juma', '2025-06-17 17:03:02', ''),
(5, 'How do I know if you have received my application?', 'After submission, a pop-up confirmation will appear. You can also login and check under \"Track Application\" for status updates.', 'Moses Juma', '2025-06-19 17:34:11', ''),
(6, 'I don\'t see my suitable job from the vacancies announced. Why?', 'Vacancies are only posted when available. If your job is not listed, kindly be patient. It may be advertised in the future.', 'Moses Juma', '2025-06-19 17:35:18', ''),
(7, 'How do I Activate my account?', 'After registration, an activation link is sent to your email. Click the link from your INBOX or SPAM folder to activate your account.', 'Moses Juma', '2025-06-19 17:36:01', ''),
(8, 'I have not received my activation link, what do I do?', 'Ensure your email is valid. If the link doesn’t arrive within 24 hours, go to the login page and click \"Resend Activation Link', 'Moses Juma', '2025-06-19 17:38:29', ''),
(9, 'I forgot my password, how do I reset it?', 'Click on the \"Forgot Password\" link and follow the on-screen prompts to reset it.', 'Moses Juma', '2025-06-19 17:39:53', ''),
(10, 'I don\'t come from Trans Nzoia, can I also apply?    \n', 'Yes. All eligible applicants are encouraged to apply, regardless of their county of origin.', 'Moses Juma', '2025-06-19 17:49:28', ''),
(11, 'How do I apply for a job?', 'Click on the Vacancies link to view available jobs. Register if new, or log in and click on \"Apply\"', 'Moses Juma', '2025-06-19 17:51:27', ''),
(12, 'How do I login?', 'Click the \"Login\" link and enter your registered email and password.\n', 'Moses Juma', '2025-06-19 17:53:13', ''),
(13, 'How do I register?', 'Click the \"Register\" link. Fill in all required fields in the form and click Register', 'Moses Juma', '2025-06-19 17:53:39', '');

