INSERT INTO `jobs` (`job_id`, `code`, `department_id`, `title`, `description`, `grade`, `category`, `experience`, `posts`, `venue`, `required_courses`, `required_certificate`, `award_id`, `is_released`, `advert_type`, `created_by`, `start_date`, `end_date`, `status`, `created_at`) VALUES
(8, '2025/1', 6, 'COUNTY DIRECTOR OF ADMINISTRATION', 'Ksh124,630 x 6,070 – 130,700 x 6,370 – 137,070 x 6,570 – 143,640 x 6,770 – 150,410 x 6,960 – 157,370 x 7,160 – 164,530 x 7,820 -172,350 p.m. \nThe County Directors of Administration will be responsible to the Chief Officer in charge of the Public Administration function.\nDuties and Responsibilities\nDuties and Responsibilities at this level will entail:- \ninitiating, interpreting, implementing and reviewing Administrative policies, strategies, procedures and programme; \ncoordinating, managing and supervising the general administrative functions in the County; \ncoordinating public service reforms; overseeing service delivering in the County; \noverseeing development of programmes and projects to empower the community; \ncoordinating and facilitating citizen participation in the development of policies, plans and delivery of services; \nfacilitating intra and inter-governmental relations and conflict resolutions; Overseeing safe custody of county government assets; \ncoordinating and liaising with other directorates and departments in the county; ensuring compliance with legal, statutory and regulatory requirements; ensuring compliance with national values and principles of good governance; and exercising any functions and powers delegated by the County Public Board under section 86.\nIn addition, the Director will be responsible for:- coordinating the development and implementation of the departmental strategic plan; ensuring the development and review of departmental annual work plans and budgets; managing departmental performance; ensuring compliance with principles and values of good management of departmental assets and finances; and overall management and development of staff.\n\nRequirements for Appointment\nFor appointment to this grade, an officer must have:-\n(i)	Served in the grade of Deputy Director Administration/ Sub-County Administrator for a minimum period of three (3) years or in a comparable and relevant position in the Public Service or Private Sector;\n(ii)	Bachelor\'s degree in any of the following disciplines: - Public Administration, Business Administration/Management, Community Development or any other Social Science from a recognized institution;\n(iii)	Master\'s degree in any of the following disciplines: Public Administration, Business Administration/Management, Community Development or any other Social Science from a recognized institution;\n(iv)	Certificate in Strategic Leadership Development Programme lasting not less than six (6) weeks or equivalent qualification from a recognized institution;\n(v)	Certificate in computer application skills from a recognized institution;\n(vi)	Certify chapter six (6) of the constitution; and\n(vii)	demonstrated a thorough understanding for national goals, policies, objectives and the ability to relate them to the administration function.\n', '15', 'Open', 3, 1, '', 13, 2, 0, 0, 1, 0, '2025-06-23', '2025-06-27', '', '2025-06-23 15:11:49'),
(9, '2025/2', 2, 'DEPUTY SUB-COUNTY ADMINISTRATOR (ASSISTANT DIRECTOR, COUNTY ADMINISTRATIVE SERVICE)', '\nKsh90,200 x 3,220 – 93,420 x 4,520 – 97,940 x 4,920 – 102,860 x 5,070 – 107,930 x 5,300 – 113,230 x 5,560 – 118,790 x 5,840 -124,630 p.m.\nDuties and Responsibilities\nAn officer at this level may also be deployed as Town Administrator. \nCounty Headquarters\nDuties and responsibilities at this level will entail: - implementing, reviewing and interpreting administrative policies, strategies, procedures and programme; supervising the general administration services; implementing county public service reforms; facilitating maintenance of infrastructure and facilities; coordinating office accommodation; and managing county government assets;\nField Administration\nDuties and Responsibilities in the Field Office will entail:- ensuring service delivering in the area of jurisdiction; facilitating mobilization and ensuring prudent utilization of resources; developing programmes and projects to empower the community; facilitating citizen participation in the development of policies, plans and delivery of services in the area of jurisdiction; facilitating intra and inter-governmental relations and conflict resolutions; safe custody of government assets in the area of jurisdiction; ensuring compliance with legal, statutory and regulatory requirements in the area of jurisdiction; ensuring compliance with national values and principles of good governance; identifying development projects; disseminating information to the Public; and providing linkage between the office and the community.\nRequirements for Appointment	\nFor appointment to this grade, an officer must have:\n(i)	Served at the grade of Principal Ward Administrator/ County Administrative Officer or in a comparable and relevant position for a minimum period of three (3) years; \n(ii)	Bachelor\'s degree in any of the following disciplines: - Public Administration, Business Administration/Management, Community Development or any other Social Science from a recognized institution;\n(iii)	Master\'s degree in any of the following disciplines: - Public Administration;\nBusiness Administration/Management, Community Development or another Social Science from a recognized institution;\n(iv)	Certificate in Strategic Leadership Development Course lasting not less than four (4) weeks from a recognized institution;\n(v)	Certificate in computer application; \n(vi)	Been a person of integrity; and\n(vii)	Shown merit and ability as reflected in work performance and results.\n', '14', 'internal', 3, 18, '', 13, 0, 0, 0, 1, 0, '2025-06-23', '2025-07-02', '', '2025-06-23 15:13:26'),
(10, '2025/3', 3, 'PRINCIPAL WARD ADMINISTRATOR (PRINCIPAL COUNTY ADMINISTRATIVE OFFICER)', 'Ksh58,360 x 2,750 – 61,110 x 2,920 – 64,030 x 3,080 – 61,110 x 3,540- 70,650 x 3,690 – 74,340 x 3,890 – 78,230 x 3,900 – 82,130 x 4,010 – 86,140 x 4,060 – 90,200 p.m.\nDuties and Responsibilities\nCounty Headquarters\nDuties and responsibilities at this level will entail:- overseeing development and updating of office equipment and furniture ; managing premises, assets and insurance policies carrying out general administrative duties; coordinating the enforcement of county laws; ensuring security of county government property, assets, facilities and inventory; facilitating day to day operations of a department and communication between sections and units between and within departments, assisting in handling general public complaints and supervising staff.\nField Administration\nAn Officer at this level maybe deployed to deputize a Sub- County Administrator.  Duties and responsibilities at this level will entail: - coordinating County Government public service and activities in the decentralized unit, supervising implementation of County Government development projects in the area of jurisdiction.\nDuties and Responsibilities in the Field Office will entail:- overseeing effective service delivering in the area of jurisdiction; developing programmes and projects to empower the community; coordinating and facilitating citizen participation in the development of policies, plans and delivery of services; facilitating inter-governmental relations and conflict resolutions; overseeing safe custody of county government assets in the area of jurisdiction; coordinating and liaising with other directorates and departments in the area of jurisdiction; ensuring compliance with legal, statutory and regulatory requirements; ensuring compliance with national values and principles of good governance; coordinating citizen participation in governance in the area of jurisdiction; enhancing administrative capacity for effective functions and governance at the local level; identifying development projects; disseminating information to the Public; and\nRequirements for Appointment	\nFor appointment to this grade, an officer must have:\n(i)	served at the grade of Chief Ward Administrator/Chief County Administrative Officer  or in a comparable position for a minimum period of three (3) years;\n(ii)	Bachelor’s degree in any of the following disciplines: - Public Administration, Business Administration/Management, Community Development or any other Social Science from a recognized institution;\n(iii)	Certificate in Senior Management Course lasting not less than four (4) weeks from a recognized institution;\n(iv)	Been a person of integrity; and\n(v)	Shown merit and ability as reflected in work performance and results.\n', '13', 'internal', 3, 2, '', 1, 1, 3, 0, 1, 0, '2025-06-23', '2025-07-03', '', '2025-06-23 15:33:48'),
(11, '2025/4', 15, 'CHIEF WARD ADMINISTRATOR/CHIEF COUNTY ADMINISTRATIVE OFFICER', '\nKsh50,610 x 2,350 – 52,960 x 2,550 – 55,510 x 2,850 – 58,360 x 2,750 – 61,110 x 2,920 – 64,030 x 3,080 – 67,110 p.m. \nDuties and Responsibilities\nCounty Headquarters\nDuties and responsibilities at this level will entail:- facilitating maintenance of infrastructure and facilities; overseeing transport management; planning and coordinating office accommodation; overseeing development and updating of office equipment and furniture inventory; overseeing facilitation of meetings, conferences and other special events; supervising general maintenance of buildings and furniture; supervising provision of security and office services; and supervising records management and messenger services within various\ndepartments; \nField Administration\nDuties and responsibilities at this level will entail the following:- coordinating County Government public service and activities in the decentralized unit, supervising implementation of  County Government development projects in the area of jurisdiction; compiling data on county administrative activities; ensuring security of county government property, assets, facilities and inventory; mobilizing communities for development, events and activities; coordinating and organizing county government functions; handling general public complaints, managing VIP visits; collecting and collating data for report compilationand dissemination of County Government policies and programs.\nRequirements for Appointment\nFor appointment to this grade, an officer must have: -\n(i)	Served at the grade of Ward Administrator I/Senior County Administrative Officer or in a comparable position for a minimum period of three (3) years;\n(ii)	Bachelor’s degree in any of the following disciplines: - Public Administration, Business Administration/Management, Community Development or any other Social Science from a recognized institution\n(iii)	Certificate in Senior Management Course lasting not less than four (4) weeks from a recognized institution;\n(iv)	Been a person of integrity; and\n(v)	Shown merit and ability as reflected in work performance and results.\n', '12', 'internal', 3, 2, '', 13, 2, 3, 0, 1, 0, '2025-06-23', '2025-07-04', '', '2025-06-23 15:42:26'),
(12, '2025/5', 3, 'WARD ADMINISTRATOR I (SENIOR COUNTY ADMINISTRATIVE OFFICER I)', '5.	, JOB GROUP ‘L’ - (2 POSTS)\nKsh44,400 x 1,920 -46,320 x 2,000 – 48,320 x2,290 – 50,610 x 2,350 -52,960 x 2,550 – 55,510 x 2,850 – 58,360 x 2,750 – 61,110 p.m.\nDuties and Responsibilities\nCounty Headquarters\nDuties and responsibilities at this level will entail (iv) supervising provision of security and office services; supervising records management services within various departments; handling public concerns and issues; managing utilities and office accommodation; managing of premises, assets and insurance policies; facilitating citizen participation in development activities; handling occupational health and safety issues; facilitating mobilization of resources at the local level; collecting and collating data on developmental activities.\nField Administration\noverseeing effective service delivering in the area of jurisdiction; developing programmes and projects to empower the community; coordinating and facilitating citizen participation in the development of policies, plans and delivery of services; facilitating inter-governmental relations and conflict resolutions; overseeing safe custody of county government assets in the area of jurisdiction; coordinating and liaising with other directorates and departments in the area of jurisdiction; ensuring compliance with legal, statutory and regulatory requirements; ensuring compliance with national values and principles of good governance; coordinating citizen participation in governance in the area of jurisdiction; handling general public complaints, managing VIP visits; collecting and collating data for report compilation and dissemination of County Government policies and programs.\nRequirements for Appointment	\nFor appointment to this grade, an officer must have:\n(i)	Served at the grade of Ward Administrator II /County Administrative Officer II or in a comparable position for a minimum period of three (3) years;\n(ii)	Bachelor\'s degree in any of the following disciplines: - Public Administration, Business Administration/Management, Community Development or any other Social Science from a recognized institution;\n(iii)	Must have senior management certificate lasting for not less than 4 weeks from a recognized institution \n(iv)	Been a person of integrity; and\n(v)	Certificate in computer applications.\n', '11', 'internal', 3, 2, '', 13, 1, 2, 0, 1, 0, '2025-06-23', '2025-07-30', '', '2025-06-23 15:45:23'),
(13, '2025/6', 15, 'ASSISTANT DIRECTOR, INFORMATION COMMUNICATION TECHNOLOGY', '\nKsh90,200 x 3,220 – 93,420 x 4,520 – 97,940 x 4,920 – 102,860 x 5,,070 – 107,930 x 5,300 – 113,230 x 5,560 – 118,790 x 5,840 – 124,630p.m.\n(a)   Duties and Responsibilities.	    \n\nAn officer at this level will either head a division at the headquarters or an ICT Unit in a Department /Department. Duties and responsibilities at the Headquarters will involve planning, monitoring and evaluating program activities; ensuring ICT goals and objectives are met; approving of ICT standards for application; liaising with users to ensure that information processing needs are met;  reviewing and evaluating feasibility studies and reports for implementation; management and coordination of the unit; Supervising ICT officers; providing assistance in the development of ICT strategic plans; ensuring that ICT projects are completed within the planned time and budget; ensuring that procedures and standards are adhered to; liaising with heads of Department in the Departments in developing and implementing change management initiatives; ensuring that officers are adequately trained; drawing up the budget for the ICT unit; and procurement of ICT equipment and services. \n\n(b)  Requirements for Appointment	  \nFor appointment to this grade, an officer must have:	\n(i)	Served in the grade of Principal Communication technology officer or in an equivalent and   relevant position in the Public Service for a minimum period of three (3) years; \n(ii)	Master\'s degree in Computer Science or any other/ICT-related discipline from a recognized Institution;\n(iii)	Attended a Strategic Leadership Development Programme lasting not less than four (4) weeks from a recognized Institution; and\n(iv)	Demonstrated professional ability, initiative, and competence in organizing and directing work. \n', '14', 'Open', 3, 2, '', 13, 0, 0, 0, 1, 0, '2025-06-23', '2025-07-10', '', '2025-06-23 15:49:59'),
(14, '2025/24', 19, 'CHIEF INFORMATION COMMUNICATION TECHNOLOGY OFFICER', '\nKsh50,610 x 2,350 – 52,960 x 2,550 – 55,510 x 2,850 – 58,360 x 2,750 – 61,110 x 2,920 – 64,030 x 3,080 – 67,110 p.m. \nDuties and Responsibilities \nDuties and responsibilities at this level will involve: coordinating systems analysis, design and programme specifications; ensuring timely implementation and effective maintenance of systems; developing reports on ICT standards; and supervising overall systems documentation; taking charge of Information Communication Technology equipment maintenance; preparing progress reports of the Information Communication Technology equipment maintenance; evaluating and recommending on the suitability of Information Communication Technology equipment; training of Information Communication Technology Hardware personnel and users; designing Local Area Network (LAN) and Wide Area Network (WAN); and preparing staff performance reports. \n Requirements for Appointment to this grade, an officer must have:\n(i)	Served in the grade of Senior Information Communication Technology Officer or in an equivalent and relevant position in the Public Service for a minimum period of three (3) years; \n(ii)	Shown merit and ability as reflected in work performance and results; and \n(iii)	Demonstrated professional ability, initiative, and competence in organizing and directing work.\n', '12', 'internal', 3, 1, '', 1, 0, 3, 0, 1, 0, '2025-06-23', '2025-07-10', 'active', '2025-06-23 17:12:19'),
(15, '2025/8', 19, 'NFORMATION COMMUNICATION TECHNOLOGY OFFICER I', 'Ksh39,700 × 1,470 – 41,170 × 1,520 – 42,690 × 1,710 –44,400 × 1,920 – 46320 × 2,000 – 48,320 × 2,290 – 50,610 × 2,350 – 52,960 p.m. \n\nDuties and Responsibilities \nDuties and responsibilities at this level will include: installation and maintenance of computer systems; configuration of Local Area Network and Wide Area Network; developing and updating application systems; and carrying out systems analysis, design and programme specifications in liaison with users; carrying out repairs and maintenance of Information Communication Technology equipment and associated peripherals; drawing up hardware specifications for Information Communication Technology equipment; verification, validation and certification of Information Communication Technology equipment; and overseeing the process of configuration of new Information Communication Technology equipment. \nRequirements for Direct Appointment to this grade\nFor appointment to this grade, an officer must have: \n(i)	Served in the grade of Information Communication Technology Officer II or in an equivalent and relevant position in the Public Service for a minimum period of three (3) years; and shown merit and ability as reflected in work performance and results\n(ii)	A candidate must have a degree in any of the following fields: Computer Science/ Information Communication Technology or in Electronics/Electrical Engineering from a recognized institution.\n', '11', 'internal', 3, 5, '', 1, 2, 2, 0, 1, 0, '2025-06-28', '2025-07-31', 'active', '2025-06-28 16:39:34');

